import styled from 'styled-components'

const Outer = styled.div`

    #hmb-logo {
        margin-top: 15px;
    }

    ul {
        margin-left: 70x;
    }

    li {
        display: inline;
        margin: 5px 60px 5px 60px;
    }
`
export default Outer
